import React from 'react';
// import CardList from '../../../../Flashcard-o-matic/src/components/cards/CardList';

function Deck({ deck, currentPage }) {
    const { cards } = deck;

    return (
        <>
            <div class="container">
                <h3>{deck.name}</h3>
                <p>{cards.length} Cards</p>
            </div>
            <p>{deck.description}</p>
            <div class="container">
                <div class="row">
                    <div class="col-3">
                        <button>View</button>
                    </div>
                    <div class="col-3">
                        <button>Study</button>
                    </div>
                    <div class="col-6">
                        <button>Delete</button>
                    </div>
                </div>
            </div>
        </>
    )



}

export default Deck;
